INSERT INTO `db_tabprefixblog` (`id`, `type`, `featured_img`, `title`, `description`, `created_by`, `create_time`, `status`) VALUES (1, 'blog', '1496241320-image-1496238504.png', '{\"en\":\"Toyota Tundra\",\"es\":\"\",\"ru\":\"Demo blog post ru\",\"ar\":\"hello world\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', '{\"en\":\"<p data-start=\\\"118\\\" data-end=\\\"374\\\">The Toyota Tundra is a full-size pickup truck designed for strength, reliability, and versatility. Built to handle tough jobs and demanding terrains, it combines powerful performance with modern comfort and advanced technology.<\\/p>\\r\\n<p data-start=\\\"376\\\" data-end=\\\"730\\\"><strong data-start=\\\"376\\\" data-end=\\\"406\\\">Marketing\\/Lifestyle Style:<\\/strong><br data-start=\\\"406\\\" data-end=\\\"409\\\" \\/> The Toyota Tundra isn&rsquo;t just a truck&mdash;it&rsquo;s a statement of power and durability. With its bold design, impressive towing capacity, and advanced safety features, the Tundra is ready for both work and adventure. Whether on city roads or rugged trails, it delivers unmatched capability with Toyota&rsquo;s legendary dependability.<\\/p>\\r\\n<p data-start=\\\"732\\\" data-end=\\\"1117\\\"><strong data-start=\\\"732\\\" data-end=\\\"763\\\">Technical\\/Automotive Style:<\\/strong><br data-start=\\\"763\\\" data-end=\\\"766\\\" \\/> The Toyota Tundra is engineered with a robust V8 (earlier models) or twin-turbo V6 hybrid powertrain (latest generation), high towing and payload capacities, and durable suspension systems. It offers advanced driver-assistance technology, spacious interiors, and multiple trims ranging from practical work-focused models to luxury-inspired variants.<\\/p>\",\"es\":\"\",\"ru\":\"<p>ru demo blog post content.<\\/p>\",\"ar\":\"<p>Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.<\\/p>\\r\\n<p>Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.Lorem ipsum doller sit amet.<\\/p>\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', 11, 1756079860, 1);
