INSERT INTO `db_tabprefixblog` (`id`, `type`, `featured_img`, `title`, `description`, `created_by`, `create_time`, `status`) VALUES (3, 'news', 'abt-audi-r81.jpg', '{\"en\":\"AUDI LAST UPDATE\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', '{\"en\":\"<p>&nbsp;<\\/p>\\r\\n<ul>\\r\\n<li data-start=\\\"52\\\" data-end=\\\"159\\\">\\r\\n<p data-start=\\\"54\\\" data-end=\\\"159\\\"><strong data-start=\\\"54\\\" data-end=\\\"76\\\">A6 e-tron launched<\\/strong> &rarr; Up to 392 miles range, sleek design, but reviews say it feels &ldquo;good but dull.&rdquo;<\\/p>\\r\\n<\\/li>\\r\\n<li data-start=\\\"160\\\" data-end=\\\"239\\\">\\r\\n<p data-start=\\\"162\\\" data-end=\\\"239\\\"><strong data-start=\\\"162\\\" data-end=\\\"178\\\">New A6 Sedan<\\/strong> &rarr; Now in dealerships, praised for luxury and aerodynamics.<\\/p>\\r\\n<\\/li>\\r\\n<li data-start=\\\"240\\\" data-end=\\\"324\\\">\\r\\n<p data-start=\\\"242\\\" data-end=\\\"324\\\"><strong data-start=\\\"242\\\" data-end=\\\"261\\\">Audi E5 (China)<\\/strong> &rarr; New EV debut, deliveries start late August&ndash;September 2025.<\\/p>\\r\\nAudi has officially begun rolling out the <strong data-start=\\\"944\\\" data-end=\\\"960\\\">new A6 Sedan<\\/strong> across its authorized dealer network. Audi highlights its innovation in design and comfort, noting an exceptionally low drag coefficient for a combustion-engine vehicle&mdash;one of the lowest in the brand&rsquo;s history.<\\/li>\\r\\n<\\/ul>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p>&nbsp;<\\/p>\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', 11, 1756080174, 1);
INSERT INTO `db_tabprefixblog` (`id`, `type`, `featured_img`, `title`, `description`, `created_by`, `create_time`, `status`) VALUES (4, 'blog', 'vanquish-s-ultimate_02.jpg', '{\"en\":\"Ferrari\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', '{\"en\":\"<p data-start=\\\"134\\\" data-end=\\\"428\\\">Ferrari is an Italian luxury sports car manufacturer, renowned worldwide for its high-performance vehicles, distinctive design, and strong racing heritage. Founded in 1939 by Enzo Ferrari in Maranello, Italy, the brand symbolizes speed, innovation, and exclusivity.<\\/p>\\r\\n<p data-start=\\\"430\\\" data-end=\\\"691\\\"><strong data-start=\\\"430\\\" data-end=\\\"457\\\">Luxury\\/Marketing Style:<\\/strong><br data-start=\\\"457\\\" data-end=\\\"460\\\" \\/> Ferrari represents the ultimate fusion of art, engineering, and passion. Every model embodies cutting-edge technology, Italian craftsmanship, and iconic styling, making Ferrari not just a car, but a lifestyle and a status symbol.<\\/p>\\r\\n<p data-start=\\\"693\\\" data-end=\\\"1014\\\"><strong data-start=\\\"693\\\" data-end=\\\"724\\\">Automotive\\/Technical Style:<\\/strong><br data-start=\\\"724\\\" data-end=\\\"727\\\" \\/> Ferrari produces high-performance sports cars and supercars powered by advanced engines, precise aerodynamics, and innovative design. Known for their distinctive &ldquo;Prancing Horse&rdquo; logo and unmatched Formula 1 legacy, Ferraris deliver exceptional speed, handling, and driving experience.<\\/p>\",\"es\":\"\",\"ru\":\"\",\"ar\":\"\",\"de\":\"\",\"fr\":\"\",\"it\":\"\",\"pt\":\"\",\"zh\":\"\",\"tr\":\"\",\"hi\":\"\",\"bn\":\"\",\"po\":\"\"}', 11, 1756079768, 1);
