INSERT INTO `db_tabprefixpages` (`id`, `alias`, `show_in_menu`, `layout`, `content_from`, `title`, `url`, `content`, `sidebar`, `seo_settings`, `create_time`, `status`, `editable`, `parent`) VALUES (1, 'home', 1, 1, 'Url', '[home]', '', '', '', '{\"meta_description\":\"search top cars near your location of various categories like coupe sedan van suv\",\"key_words\":\"sale,rent,buy,classified,cms,whiz,electronics,real estate,pets,fashion\",\"crawl_after\":\"3\"}', 1522345431, 1, 0, 0);
