INSERT INTO `db_tabprefixpages` (`id`, `alias`, `show_in_menu`, `layout`, `content_from`, `title`, `url`, `content`, `sidebar`, `seo_settings`, `create_time`, `status`, `editable`, `parent`) VALUES (3, 'about', 1, 1, 'Manual', '[about]', 'page/about', '<p>&nbsp;</p>\r\n<p>أوتو تي إن (AutoTN) هو أول سوق إلكتروني في تونس وشمال إفريقيا لتأجير وشراء وبيع المركبات الجديدة والمستعملة. يوفر منصة يمكن للأفراد والمحترفين من خلالها شراء وبيع أو تبادل السيارات والدراجات النارية والكامبر فان وأنواع أخرى من المركبات.</p>\r\n<p>&nbsp;</p>\r\n<p>AutoTN is the first online marketplace in Tunisia and North Africa for renting, buying, and selling new and used vehicles. It provides a platform where both individuals and professionals can buy, sell, or trade cars, motorcycles, camper vans, and other types of vehicles.</p>\r\n<p>&nbsp;</p>\r\n<p>AutoTN est la première place de marché en ligne en Tunisie et en Afrique du Nord pour la location, l\'achat et la vente de véhicules neufs et d\'occasion. Elle sert de plateforme où les particuliers et les professionnels peuvent acheter, vendre ou échanger des voitures, motos, camping-cars et autres types de véhicules.</p>\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n<p>توفر المنصة أدوات بحث متقدمة تسمح للمستخدمين بتصفية الإعلانات حسب الماركة، الطراز، السعر، عدد الكيلومترات، السنة، والمزيد. كما تقدم AutoTN خدمات إضافية مثل نصائح التمويل، خيارات التأمين، وتقييم المركبات لتسهيل عملية البيع والشراء بأمان.</p>\r\n<p>&nbsp;</p>\r\n<p>The platform offers advanced search tools that allow users to filter listings by brand, model, price, mileage, year, and more. In addition, AutoTN provides extra services such as financing advice, insurance options, and vehicle valuation to make the buying and selling process easier and more secure.</p>\r\n<p>&nbsp;</p>\r\n<p>Le site propose des outils de recherche avancés permettant aux utilisateurs de filtrer les annonces par marque, modèle, prix, kilométrage, année et plus encore. AutoTN offre également des services supplémentaires tels que des conseils de financement, des options d’assurance et l’évaluation des véhicules pour faciliter le processus d’achat et de vente en toute sécurité.</p>\r\n<p>&nbsp;</p>\r\n', '<p>Phone : +216 93413541</p>\r\n<p>Mail : saadaouikarim2002@gmail.com</p>', '{\"meta_description\":\"\",\"key_words\":null,\"crawl_after\":\"\"}', 1755431059, 1, 0, 0);
